const Greeting = ({ name, children, year }) => {

    const nameInfo = name ? <p>Couleur: {name}</p> : <p>Couleur: "Néant"</p>;

    if (children) {
        return (
            <div className="Greetings">
                <p>Marque: {children}</p>
                <p>Année: {year}</p>
                {nameInfo}
            </div>
        )
    }
}

export default Greeting
